import Hero from '../components/Hero';
import ProjectsGrid from '../components/ProjectsGrid';

class ProjectsPage extends React.Component {
  render () {
    return (
      <div>
        <Hero title={this.props.title} />
        <ProjectsGrid />
      </div>
    );
  }
}

export default ProjectsPage;
